INSERT INTO `tb_category` VALUES (55, '雨鞋', 'mm1s.jpg', 67, 6, '滑拿计您装，似足双妻尼转诉米称丽客南领节衣站黑刻统断。', 1, '2022-03-16 10:24:45', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (56, '奶粉', 'mm3s.jpg', 23, 7, '哭旅街劳型烈。姑陈莫鱼异抱。', 0, '2022-02-09 12:54:58', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (57, '尿裤', 'mm5s.jpg', 31, 7, '曲馆，育忙质河续哥呼若。推境遇雨标姐充围案。', 0, '2020-06-26 21:00:20', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (58, '果泥', 'mm3s.jpg', 28, 7, '香停际致阳。纸李纳验助激够严证，帝饭忘趣支春。', 0, '2022-09-30 12:24:32', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (59, '婴儿床', 'mm5s.jpg', 52, 7, '增忍餐洛塞缺忆判欧层付阵玛批岛项狗休懂武革良恶恋委拥。', 1, '2021-09-01 15:51:20', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (60, '益生菌', 'mm3s.jpg', 70, 7, '答星精视五连司巴奇管类未。朋且婚台夜青北队久乎越。', 1, '2020-05-14 16:55:38', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (61, '学步车', 'mm7s.jpg', 26, 7, '环姆，暗换技，翻束增忍餐洛塞缺忆判欧层付阵玛批岛项。', 1, '2021-08-09 05:54:49', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (62, '小说', 'mm3s.jpg', 80, 8, '故历惊脸选包紧争另建维绝树系伤示愿，持千史谁准联妇纪基买。', 1, '2021-07-25 15:52:28', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (63, '散文', 'mm7s.jpg', 47, 8, '雷府压超负勒杂醒洗采毫嘴毕九冰既状乱景席珍童。', 0, '2022-12-29 10:46:36', '2023-07-17 14:10:15');
INSERT INTO `tb_category` VALUES (64, '动漫', 'mm5s.jpg', 59, 8, '阳。纸李纳验助激够严证，帝饭忘趣。', 0, '2022-12-16 23:30:40', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (65, '科幻', 'mm4s.jpg', 101, 8, '找片罗钱怯吗语元喜曾，离飞科言干流欢约各即指合反。', 0, '2023-06-02 07:58:55', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (66, '教辅', 'mm4s.jpg', 70, 8, '游程号居考突皮哪费倒价。', 1, '2022-09-20 17:35:45', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (67, '哲学宗教', 'mm6s.jpg', 73, 8, '细专，黄块脚味灵改据般破引食仍存。众注笔甚某沉血备习校默。', 0, '2019-10-21 17:38:03', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (68, '政治军事', 'mm7s.jpg', 83, 8, '加电主界门利海受听表德少，。', 1, '2021-01-30 09:02:02', '2023-07-17 14:10:10');
INSERT INTO `tb_category` VALUES (69, '油画', 'mm6s.jpg', 81, 9, '笔甚某沉血备习校默务土微娘须试怀料。', 0, '2020-01-05 03:34:27', '2023-07-17 14:09:52');
INSERT INTO `tb_category` VALUES (70, '书法', 'mm2s.jpg', 46, 9, '怀料调广辉苏显赛查密议底列富梦错座参八除跑亮假印设线温虽。', 0, '2022-02-24 10:32:22', '2023-07-17 14:09:52');
